import moment from 'moment';
const transformForecast=(data)=>(
    data.list.filter(item =>(
        moment.unix(item.dt).hour()===6 ||
        moment.unix(item.dt).hour()===12||
        moment.unix(item.dt).hour()===8 

    ))
);
export default transformForecast;
